replyComment:
@Queen Babylonia Indeed..but I have lived in three actual dictatorships, and still prefer a flawed or broken system to a non-existent one. 💕
Edit: Incidentally, when I said "confusing Law and Justice" I wasn't meaning to be rude or nasty! I meant it in the same way as the difference between "Knowing something" and being able to "Prove it"...the law of course seeks to provide justice, but can only do so within very strict and clearly defined confines. You can change laws, or constantly introduce new ones, but judges cannot allow straying outside of established ones; that is their very role and purpose.
It just occurred to me it may have sounded unintentionally dismissive!
